import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

const VisionPage = () => {
  const [visionText, setVisionText] = useState('');
  const [weeklyGoals, setWeeklyGoals] = useState('');
  const [monthlyGoals, setMonthlyGoals] = useState('');
  const [yearlyGoals, setYearlyGoals] = useState('');
  const [activeTab, setActiveTab] = useState('weekly');
  const [isEditing, setIsEditing] = useState(true);

  const navigate = useNavigate();

  useEffect(() => {
    const savedVision = localStorage.getItem('visionData');
    if (savedVision) {
      const data = JSON.parse(savedVision);
      setVisionText(data.visionText || '');
      setWeeklyGoals(data.weeklyGoals || '');
      setMonthlyGoals(data.monthlyGoals || '');
      setYearlyGoals(data.yearlyGoals || '');
      setIsEditing(false);
    }
  }, []);

  useEffect(() => {
    const visionData = {
      visionText,
      weeklyGoals,
      monthlyGoals,
      yearlyGoals,
    };
    localStorage.setItem('visionData', JSON.stringify(visionData));
  }, [visionText, weeklyGoals, monthlyGoals, yearlyGoals]);

  const resetVision = () => {
    setVisionText('');
    setWeeklyGoals('');
    setMonthlyGoals('');
    setYearlyGoals('');
    localStorage.removeItem('visionData');
    setIsEditing(true);
    alert('🗑️ כל המידע נמחק בהצלחה!');
  };

  return (
    <div className="container mx-auto p-8 bg-gray-50 rounded-md shadow-md">
      {/* כותרת ראשית */}
      <h1 className="text-3xl font-bold mb-6 text-center">🌟 חזון אישי ויעדים 🌟</h1>

      {/* כפתורי פעולה */}
      <div className="flex gap-4 justify-center mb-6">
        <button
          onClick={() => setIsEditing(true)}
          className={`bg-yellow-500 text-white px-4 py-2 rounded-md ${
            isEditing ? 'opacity-50 cursor-not-allowed' : ''
          }`}
          disabled={isEditing}
        >
          ✏️ ערוך
        </button>
        <button
          onClick={resetVision}
          className="bg-red-500 text-white px-4 py-2 rounded-md"
        >
          🗑️ מחק
        </button>
      </div>

      {/* חזון אישי */}
      <section className="mb-8">
        <h2 className="text-xl font-bold mb-2">📜 כתיבת חזון אישי</h2>
        <textarea
          value={visionText}
          onChange={(e) => setVisionText(e.target.value)}
          placeholder="כתוב את החזון האישי שלך כאן..."
          className="w-full h-32 p-2 border rounded-md"
          disabled={!isEditing}
        />
      </section>

      {/* כרטיסיות יעדים */}
      <section className="mb-8">
        <h2 className="text-xl font-bold mb-2">🎯 יעדים</h2>
        <div className="flex gap-4 mb-4">
          <button
            onClick={() => setActiveTab('weekly')}
            className={`px-4 py-2 rounded-md ${
              activeTab === 'weekly' ? 'bg-blue-500 text-white' : 'bg-gray-200'
            }`}
          >
            🗓️ שבועיים
          </button>
          <button
            onClick={() => setActiveTab('monthly')}
            className={`px-4 py-2 rounded-md ${
              activeTab === 'monthly' ? 'bg-blue-500 text-white' : 'bg-gray-200'
            }`}
          >
            📅 חודשיים
          </button>
          <button
            onClick={() => setActiveTab('yearly')}
            className={`px-4 py-2 rounded-md ${
              activeTab === 'yearly' ? 'bg-blue-500 text-white' : 'bg-gray-200'
            }`}
          >
            🏆 שנתיים
          </button>
        </div>

        {activeTab === 'weekly' && (
          <textarea
            value={weeklyGoals}
            onChange={(e) => setWeeklyGoals(e.target.value)}
            placeholder="הזן את היעדים השבועיים שלך כאן..."
            className="w-full h-32 p-2 border rounded-md"
            disabled={!isEditing}
          />
        )}
        {activeTab === 'monthly' && (
          <textarea
            value={monthlyGoals}
            onChange={(e) => setMonthlyGoals(e.target.value)}
            placeholder="הזן את היעדים החודשיים שלך כאן..."
            className="w-full h-32 p-2 border rounded-md"
            disabled={!isEditing}
          />
        )}
        {activeTab === 'yearly' && (
          <textarea
            value={yearlyGoals}
            onChange={(e) => setYearlyGoals(e.target.value)}
            placeholder="הזן את היעדים השנתיים שלך כאן..."
            className="w-full h-32 p-2 border rounded-md"
            disabled={!isEditing}
          />
        )}
      </section>

      {/* מעבר לסיכום */}
      <section className="mt-8 text-center">
        <h2 className="text-xl font-bold mb-2">📊 סיכום שבועי/חודשי/שנתי</h2>
        <p>ניתן להציג את ההישגים והתובנות שלך בצורה ויזואלית ומעמיקה.</p>
        <button
          onClick={() => navigate('/vision/summary')}
          className="bg-purple-500 text-white px-4 py-2 rounded-md mt-4"
        >
          עבור לדף הסיכום
        </button>
      </section>
    </div>
  );
};

export default VisionPage;
